fe= ["Siento cosas por ti desde que nos vimos por primera vez; desde que descendieron del cielo los ángeles a revolotear suavemente alrededor de nuestro amor. Pero nunca como las siento cuando no me haces falta por mucho tiempo y te he tenido todas las veces que te necesitaba; cuando ya no te espero porque estabas conmigo ayer, y sigues aquí hoy, jugando con tus pies en la borrachera y sonriendo con las cosas que vemos en televisión.", "I feel things for you since we saw each other for the first time; since descended from heaven the angels to flutter softly around our love. But never like I feel them when I do not miss you for a long time and have had you all the times that needed you; when I no longer wait for you because you were with me yesterday, and are still here today, playing with your feet in the drunkenness and smiling with the things we see on the television.", "He esperado toda mi vida para verte así. Ni siquiera te conocía, pero ya te había visto antes; en las noches negras en mi mente colorida; pintando el blanco de tus dientes con el pincel de mis pensamientos, cuyas decisiones las pinta dependiendo de la voluntad de la libertad, que son tus dientes blanquísimos, y no puede más que alabar a su diosa, tus dientes blanquísimos, y pintarlos y pintarlos. Y hoy estás justo como te veía.", "I have waited all my life to see you like this. I did not even know you, but had already seen you before; in the black nights in my colorful mind; painting the white of your teeth with the brush of my thoughts, whose decisions it paints depending on the will of the freedom, which are your very white teeth, and can only praise its goddess, your very white teeth, and paint them and paint them. And today you are just like I used to see you.", "En una deportiva en que nos quepan las carpas y las maletas para recorrer toda Colombia en camioneta, quiero emprender un viaje contigo por todo el país; parar cada vez que demos con el océano y adentrarnos en los bosques con carretera. Veinte meses o lo que nos tardemos; pero toda Colombia, mejor. Comeremos en los paraderos para camioneros y viajeros y en los pueblos que nos acepten, y nos bañaremos en las lagunas y los lagos.", "In an SUV in which we can fit the tents and the cases to travel all of Colombia in 4x4, I want to undertake a trip with you through all of the country; to stop every time we stumble upon the ocean and going inside the forests with road. Twenty months or whatever it takes us; but all of Colombia, preferably. We will eat at the stops for truckers and travelers and in the villages which accept us, and will bath in the lagoons and the lakes.", "Faro Cercano queda en las afueras de Isla Primavera, ilumina a los barcos por las noches y de día sirve como referencia para los pescadores que pescan lejísimos. Se ve muy hermoso con la neblina de las mañanas por ejemplo y me sirvió de inspiración para escribir esta canción:\n\nFaro Cercano, Faro Cercano\nCómo alumbras la niebla\nCómo giras, cómo giras\nComo un trompo perpetuo\n\nY las algas\nQue te abrazan\nY las gaviotas\nQue te rodean.", "Near Beacon is on the outskirts of Spring Island, it gives light to the ships at night and at day time serves as a reference to the fishers who fish very far away. It looks very beautiful with the fog of the mornings for example and served me as an inspiration for writing this song:\n\nNear Beacon, Near Beacon\nHow you light up the fog\nHow you spin, how you spin\nLike a perpetual top\n\nAnd the algae\nThat hug you\nAnd the gulls\nThat surround you.", "Nunca te romperé el corazón, nunca me saldré con la mía en eso de no adorarte. Sólo espero que te busques un buen asiento en la película de verme hablarte, porque tal vez esté un poco nervioso, y sé que te entretiene verme balbucear cosas sin sentido para ti que yo con esfuerzo intento mantener en el español. Pero en las otras cosas no tendremos problemas y puedes esperar una experiencia muy divertida, muy cómoda y emocionante.", "I will never break your heart, will never get away with mine at that of not adoring you. I only hope you search yourself a good seat in the movie of seeing me talking to you, because maybe I be a little nervous, and I know that it entertains you to watch me babble nonsenses for you that I try hard to keep in spanish. But in the other things we will not have problems and you can expect a very fun experience, very comfortable and exciting.", "Tienes unos ojos negros de gatita. Me haces sentir increíblemente halagado cuando me miras así, penetrando mi alma y doblegando mi voluntad con tus ojos negros de gatita. Espero que nunca dejes de darme unos minutos perdido en el infinito universo negro con estrellas y planetas que son tus ojos negros de gatita, que no me perdones y me castigues con tus ojos negros de gatita, que te los regaló Dios o Satanás, pero a mí también.", "You have some kitty like black eyes. You make me feel incredibly lauded when you look at me like that, penetrating my soul and bending my will with your kitty like black eyes. I hope you never stop giving me a few minutes lost in the infinite black universe with stars and planets that is your kitty like black eyes; that you do not forgive me and punish me with your kitty like black eyes, that gave you God or Satan, but so they did to me.", "Tu cabello lo incendian las llamas del Infierno\nEres un ángel demoníaco del amor\nEres la musa que creó la poesía con todo lo que conoce\nLos olores que producen las flores cuando es primavera\nYo soy buda viendo una mariposa\nSintiendo como descansa entre los dedos de sus manos\nDejando ver sus alas de colores\nCuando estás al frente mío\nCruzando tus piernas en tu taburete\nY tomando apuntes tan ordenada\nCon tus rizos color caramelo.", "Your hair is set on fire by the flames of Hell\nYou are a demonic angel of love\nYou are the muse which created the poetry with everything it knows\nThe smells which produce the flowers when it is spring\nI am Buddha looking at a butterfly\nFeeling how it rests in between the fingers of his hands\nLetting be seen its color wings\nWhen you are in front of me\nCrossing your legs in your chair\nAnd taking notes so neat\nWith your curls color caramel.", "Cómo me recorre la sangre el cuerpo\nCómo te acomodas en mi conciencia para siempre\nDesde este mismo instante\nEres el viento que mueve los árboles\nLa brisa se desliza en tu camisa\nSimplemente humedece suavemente tu piel\nLas gotitas te recorren violentas el cuerpo\nSe desgarran dentro del tiempo mis recuerdos\nYa sólo recuerdo una cosa\nCuánto te debí haber amado toda mi vida\nY sólo puedo pensar en una cosa\nEn cómo pude olvidar eso.", "How it goes through my body the blood\nHow you settle in my conscious forever\nFrom this very instant\nYou are the wind which moves the trees\nThe breeze slides on your shirt\nIt simply moists softly your skin\nThe little drops go violently through your body\nThey tear apart inside the time my memories\nNow I only remember one thing\nThat how much I should have loved you all of my life\nAnd I can only think of one thing\nIn how could I forget that.", "La playa de noche; poquísimos días para morirme, según mi esposa, Sara. Sara me juró que me iba a atravezar con una bala disparada a kilómetros por hora de la pistola que le regalé cuando nos casamos; no debí; casarme...; no lo sé, no me arrepiento; pero sí de haberle dado esa pistola, sé que no lo haría sin todo ese simbolismo, que se conformaría con darme la ley del silencio hasta que deje de vivir, horas.", "The beach at night; extremely few days for me to die, according to my wife, Sara. Sara swore to me that she was going to cross me with a bullet shot at kilometers per hour from the pistol I gave to her when we got married; I should not have; gotten married...; I do not know, I do not regret it; but yes having given her that pistol, I know that she would not do that without all that symbolism, that she would have settled with giving me the ice treatment until I stop living, hours.", "Hay playas sin direcciones ni turistas, que resultan exclusivas para los lugareños que sabemos de ellas. Nos metemos por sitios conocidos sólo por pocos, con dulces, comida, cosas, luces e I e bajamos en chanclas hasta el mar y allí encendemos una fogata; siempre de noche y hasta el próximo Sol. A veces pasan barcos, pero solo una vez vimos un avión, sin contar las avionetas y ultraligeros, que sí se ven a menudo en los cielos.", "There are beaches with no address nor tourists, which end up being exclusive to the locals who know of them. We enter though places known only by few, with sweets, food, things, lights, and I and we go down in flip flops to the sea and there we light a bonfire; always at night and up to the next Sun. At times boats pass by, but we only saw a plane once, not counting the small planes and ultralights, which are yes seen often in the skies.", "Como estrellas cayentes del cielo, eres el mejor momento hecho altitud. Te tengo un poco de amor que derrocharte; si quieres. Pocas ocasiones he visto lo que vistes, siempre me fijo en tu mirada, pero te prometo que no despertaré una sola noche al lado tuyo sin notar que antes éramos menos sombríos, en medio de más sombras. Te quiero contar de infinito hasta cero con mi lengua enredada en la tuya, toda la eternidad, toda, toda.", "Like falling from heaven stars, you are the best moment made altitude. I have you a bit of love to splurge you on; if you want to. Few occasions I have seen what you wear, I always look at your gaze, but promess you I will not wake up even one night at your side without noticing that before we were less shadowey, among more shadows. I want to count you from infinite to cero with my tongue entangled in yours, all eternity, it all, it all.", "El día menos pensado te pasaré por una de tus carreteras; te tocaré la pintura amarilla hasta el punto de desgastarla, combinaré sus curvas con sus líneas y siempre se sabrá lo que fue combinado; se verá combinado y se verá sin combinar; y las líneas blancas serán blancas y las amarillas amarillas; y espero que me entiendas a mí y a mi carro con un volante. Mis elogios, hoy; grandes elegías sin anonimatos o simples distintivos.", "The less expected day I will pass you by one of your roads; will touch your yellow paint up to the point of wearing it off, will mix its curves and its lines and it will always be known what was mixed; it will be seen mixed and will be seen without mixing; and the white lines will be white and the yellow yellow; and I hope you get me and my car with a wheel. My compliments, today; great elegies with no anonymities or simple distinctives.", "Mi guitarra eléctrica relampaguea con sonidos por el aire del concierto, apaga la vida del dolor con su madera; pocas veces he sido hombre, pero muchas he nacido; tengo que parar de alimentarme con la parte de adentro de mi piel, tengo un uno, tengo un dos, tengo un tres; que tengas infinitos unos. Para Laura, mi vida, las palabras polisemánticas que he visto, luego de haberlas dejado ir por ahí, y además muchos miles de miles.", "My electric guitar flashes with sounds throughout the air of the concert, shuts down the life of the pain with its wood; few times I have been a man, but many I have been born; I have to stop feeding myself with the inner part of my skin, I have a one, I have a two, I have a three; may you have infinite ones. For Laura, my life, the polysemantic words I have seen, after having let them go around. And moreover many thousands of thousands.", "Cuando recuerdo los tiempos efímeros, que yo decía que no eran efímeros y tú me hablabas de la efimeridad que era un hecho, los días grises sin lluvia pero neblados, los estados de mi espíritu tan sorprendido por los sentimientos, y mi alma tan versátil en sus emociones; cuando pienso en todo eso únicamente me queda verte a los ojos desde afuera, mirar tu mirada y darme cuenta de que me quieres; de que me quieres demasiadísimo.", "When I remember the ephemeral times, which I said were not ephemeral and you talked to me about the ephemerality which was a fact, the gray days with no rain but fogged, the states of my spirit so surprised by the feelings, and my soul so versatile in its emotions; when I think about all that I have nothing left but to look into your eyes from the outside, to look into your gaze and to realize that you love me; that you love me too much.", "Si las mañanas fueran azules cielos blancos por las nubes. Tengo un televisor que muestra una película de terror que no estoy viendo y se está repitiendo desde anoche. Quiero que estés aquí todos los días, que me quieras con tus hegemonías, que estemos siempre a un paso de una vieja vida, y nos sostengamos firmes a esta; encima de todo no quedará nada, y abajo de encima de todo tampoco. ¿Quieres estar conmigo toda nuestra vida?", /**/"If the mornings were blue skies white through the clouds. I have a televisor which shows a horror movie that I am not watching and it is repeating since last night. I want you to be here every day, that you love me with your hegemonies, that we be always one step away from an old life, and hold on tight to this one; above everything there will be nothing left, and below above everything neither. Do you want to be with me all of our life?"];                
                    
  
